import React from 'react';
import Button from '@mui/material/Button';
import { useNavigate } from 'react-router-dom';


const Root = () => {


    const navigate = useNavigate();
    
    const redirectToAuth = () => {
        navigate('/auth');
    }



    return (
        <div style={{
            display:'flex',
            flexDirection : "column",
            alignItems : "center"
        }}>
        <h1 style={{color:'red'}}>
            Welcome to our app
        </h1>

        <Button variant="contained" onClick={redirectToAuth}>Get started</Button>
        </div>
    
    )
}

export default Root;
